import React from "react";
import { useDraggable } from "@dnd-kit/core";

function Draggable({children, iconId}) {
    const {attributes, listeners, setNodeRef, transform} = useDraggable({
        id:iconId
    })
    return (
        <div ref={setNodeRef} {...attributes} {...listeners} style={{transform:transform ? `translate3d(${transform.x}px, ${transform.y}px, 0)` : undefined}}>
            {children}
        </div>
    )
}

export default Draggable;
